import React from "react";
import data from "../data";
export default function Card(props) {
   const personaje = { props }
   return (
      <div>
         <button onClick={() => window.alert('Emulamos que se cierra la card')}>X</button>
         <h2>id: {personaje.id}</h2>
         <h2>name: {personaje.name}</h2>
         <h2>status: {personaje.status}</h2>
         <h2>specie: {personaje.specie}</h2>
         <h2>gender: {personaje.gender}</h2>
         <h2>origin: {personaje.origin}</h2>

  
     
         <img src={personaje.imagen} alt={personaje.name} />
      </div>
   );
}
